import React from "react";
import { Container, Typography, Avatar } from "@mui/material";

const Intro = () => {
  return (
    <Container id="intro" sx={{ textAlign: "center" }}>
      {/* Add your profile picture here */}
      <Avatar alt="Your Name" src="/developer.png" sx={{ width: 250, height: 250, margin: "auto" }} />

      <Typography variant="h2" align="center" mt={3} mb={3}>
        Welcome to My Portfolio
      </Typography>
      <Typography variant="body1" align="center" color="textSecondary" paragraph>
        Hi, I'm a passionate front-end developer. Explore my projects and skills to learn more about my work.
      </Typography>
    </Container>
  );
};

export default Intro;
